import React from 'react'
import { TextField } from '@mui/material'
const TextFill = () => {
  return (
    <div>
        <TextField type={'text'} placeholder='name' sx={{margin:3}} variant='outlined'/>
        <TextField type={'email'} placeholder='email' sx={{margin:3}}  variant='standard'/>
        <TextField type={'passowrd'}placeholder='password' sx={{margin:3}}  variant='filled'/>
    </div>
  )
}

export default TextFill
